def renderBubbleMap(pId: String, airport: String, map: String, data: String) = {
    print(s"""%html
        <div id="map_${pId}"></div>
        <script>
        jQuery.when(
            jQuery.getScript('//cdnjs.cloudflare.com/ajax/libs/proj4js/2.3.6/proj4.js'),
